import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './components/App';
import Header from './components/Header';
import Main from './components/Main';
import Footer from './components/Footer';
import PopupWithForm from './components/PopupWithForm';
import reportWebVitals from './reportWebVitals';

ReactDOM.render(
  <React.StrictMode>
    <Header />
    <Main />
    <App />
    <Footer />
    <PopupWithForm name="user-info" title="Редактировать профиль">
      <label className="form__field">
        <input id="name-input" className="form__input form__input_type_name" name="name" type="text"
          minLength="2" maxLength="40" required />
        <span className="form__error name-input-error"></span>
      </label>
      <label className="form__field">
        <input id="about-input" className="form__input form__input_type_about" name="about" type="text"
          minLength="2" maxLength="200" required />
        <span className="form__error about-input-error"></span>
      </label>
    </PopupWithForm>
    <PopupWithForm name="add-card" title="Новое место">

    </PopupWithForm>
    <PopupWithForm name="edit-avatar" title="Обновить аватар">

    </PopupWithForm>
    <PopupWithForm name="delete-card" title="Вы уверены?">

    </PopupWithForm>
  </React.StrictMode>,
  document.getElementById('root')
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
